import "./App.css";
import Home from "./components/home/home";
import {Routes, Route, useNavigate} from "react-router-dom";


function App() {
  const navigate = useNavigate();
  return (
     <EthProvider>
      <div id="App" >
      <Routes>
      <Route exact path="/" element={<Home />} />
      </Routes>
        <div className="container">
          <Home/>
        </div>
    </div>
    </EthProvider> 
  );
}

export default App;
